import React,{useEffect} from 'react';
import SectionOne from './sectionOne';
import "./Meta.css";
import FooterSection from '../homeFolder/footerSection';
import Course from '../../course';
import Animation from './animation';
import metateskimg from './metaImg/metateskimg.png'

const Metatesk = () => {
  const data = Course.Course
  useEffect(() => {
    window.scrollTo(0, 0)
  }, [])
  return (
    <article>
      <div className="col-md-12 main-about metatesk-header"  >
        <img src={metateskimg} alt="metatesk" />

      </div>
      <SectionOne />
      <FooterSection data={data} />
      {/* <Animation /> */}
    </article>
  )
}

export default Metatesk
